        body{
            font: 62.5% "Trebuchet MS", sans-serif;
            margin: 50px;
        }
        .demoHeaders {
            margin-top: 2em;
        }
        #dialog-link {
            padding: .4em 1em .4em 20px;
            text-decoration: none;
            position: relative;
        }
        #dialog-link span.ui-icon {
            margin: 0 5px 0 0;
            position: absolute;
            left: .2em;
            top: 50%;
            margin-top: -8px;
        }
        #icons {
            margin: 0;
            padding: 0;
        }
        #icons li {
            margin: 2px;
            position: relative;
            padding: 4px 0;
            cursor: pointer;
            float: left;
            list-style: none;
        }
        #icons span.ui-icon {
            float: left;
            margin: 0 4px;
        }
        .fakewindowcontain .ui-widget-overlay {
            position: absolute;
        }
        
        .terrain_coast {
            background-color: aqua;
        }

        .terrain_ocean {
            background-color: #70B8FF;
        }
        
       .terrain_plains {
            background-color: #EAE8D0;
        }
        
       .terrain_grass {
            background-color: #9FDB9F;
        }

       .terrain_tundra {
            background-color: #BABABA;
        }
        
       .terrain_ice {
            background-color: #F0F8FF;
        }
        
       .terrain_desert {
            background-color: #FFF9E0;
        }
        
       .terrain_peak {
            background-color: brown;
        }
        
        .hill {
            background-image: url("doc/icons/hill.png");
        }
        
        .jungle {
            background-image: url("doc/icons/jungle.png");
        }
        
        .junglehill {
            background-image: url("doc/icons/junglehill.png");
        }
        
        .forest {
            background-image: url("doc/icons/forest.png");
        }
        
        .foresthill {
            background-image: url("doc/icons/foresthill.png");
        }
        
        table {
            border-spacing: 0px !important;
            table-layout: fixed;
            border-collapse: collapse; 
            padding: 0;
            margin: 0;
            border: 0;
        }
        
        img {
            border: 0px;
            width: 19px !important;
            height: 19px !important;
        }
        
        tr {
            height: 19px;
            font-size: 0px;
        }
        
        thead {
            width: 19px;
            height: 19px;
        }
        
        td div {
            padding: 0px;
            border: 0px;
            margin: 0px;
            font-size: 0px;
            width: 19px !important;
            height: 19px !important;
        }
        
        td div:hover {
            padding: 0px;
            border: 0px;
            margin: auto;
            font-size: 0px;
            font-size: 0px;
            width: 15px !important;
            height:15px !important;
            background-position-y: -2px;
            background-position-x: -2px;
        }
        
        td:hover {
            background-color: yellow;
            border: 0px;
            margin: 0px;
            padding: 0px;
            width: 19px;
            height: 19px;
            font-size: 0px;
        }
        
        td {
            background-color: blue;
            border: 0px;
            margin: 0px;
            padding: 0px;
            width: 19px !important;
            height: 19px !important;
            max-width: 19px !important;
            max-height: 19px !important;
            font-size: 0px;
        }
        
        .isNOfRiver {
            height: 18px !important;
            margin-bottom: 1px;
            background-position-y: -1px;
        }
        
        .isWOfRiver {
            width: 18px !important;
            margin-right: 1px;
            background-position-x: -1px;
        }
        
        img:hover {
            margin-top: -2px;
            margin-left: -2px;
        }
